import React from 'react';
import { Row } from 'react-bootstrap';
import '../index.css'

const Header = () => {
    return <>

        <row>
            <p className='center mt-4'>قائمه الطعام</p>
            <div className='line'>
               <p className='line'></p>
                
            </div>
        </row>




    </>;
}

export default Header;
